var certificateModule = (function(){
    
    return{
        generateCertificate : function(data){
        
            var imageData = "data:image/jpeg;base64,";
            var doc = new jsPDF();
            doc.addImage(imageData, 'JPG', 15, 40, 180, 140);
            
            //Heading of the certificate
            doc.setFont("times");
            doc.setFontType("italic");
            doc.setTextColor(29, 210, 242);
            doc.setFontSize(21);
            doc.text(105, 73, 'TYPING SPEED CERTIFICATE', 'center');
            
            //add text
            doc.setTextColor(96, 96, 96);
            doc.setFontSize(14);
            doc.text(105, 83, 'This Certificate is Herby Awarded to:', 'center');
            
            //add name of the user
            var button = event.target;
            var nameField = button.parentElement.previousElementSibling.children[1].children[1];
            console.log(nameField);
            var name =  nameField.value;           doc.setTextColor(29, 210, 242); 
            doc.setFontSize(19);
            doc.text(105, 92, name ,'center');
            
            //add text
            doc.setTextColor(96, 96, 96);
            doc.setFontSize(14);
            doc.text(105, 100, 'For achieving Results noted below as documented', 'center');
            doc.text(105, 107, 'and verified by Keyboard Master', 'center');
            
        
            //add results
            var level = event.target.getAttribute('level');
            
            doc.text(105, 117, 'Level : '+level, 'center');
            
            doc.text(105, 124, 'Average Speed : ' +data.wpm + ' wpm', 'center');
            
            doc.text(105, 131, 'Accuracy : '+ data.accuracy +'%', 'center');
            
            //adding date
            var date = new Date();
            date = date.toLocaleDateString('en-US');
            doc.setFontSize(13);
            doc.text(123, 142, 'Awarded on :' + date);
            //add brand
            doc.text(123, 150, 'KEYBOARD MASTER');
            //saving the things to the certificate and downloading it
            doc.save('acv_certificate.pdf');
        }    
    };
    
})();